const Favorites = () => {
    const favorites = [];

    return (
        favorites.length > 0 ? (
            favorites.map(e => (
                <div key={e.id}>
                    xuy
                </div>
            ))
        ) : (
            <div style={
                { "textAlign": "center",
                "margin": "100px 0px"    
            }
            }>
                <h1>You haven't choose yet</h1>
            </div>
        )
    );
};

export default Favorites;
